script: |
  super -f text -I q1289.spq | sort > q1289.out

inputs:
  - name: q1289.spq
    data: |
      SELECT ALL + col1 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT ( col1 - - col1 * col1 NOT IN ( col2 + col0 ) ) AND NULL NOT BETWEEN + col1 * col1 AND ( NULL );
  - name: tab2

outputs:
  - name: q1289.out
    data: |
